import styles from '../../src/App.module.scss';
import React, { Component } from "react";
import { Link } from 'react-router-dom';

class Connect extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div>
                <h1 className={styles.Header}>Connect for Black Lives</h1>
                <p>FInd civic organizations in your area that you can support</p>

                <div className="grid-container">
                    <div class="item1">Header</div>
                    <div class="item2">Menu</div>
                    <div class="item3">1</div>  
                    <div class="item4">2</div> 
                    <div class="item4">3</div> 
                    <div class="item4">4</div> 
                    <div class="item4">5</div>
                    <div class="item4">6</div>  
                </div>
            </div>
        )
    }
}

export default Connect;
